import React from 'react';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

// Exportando componentes funcionais
export const SearchIcon = (props) => <BsSearch {...props} />;
export const ChartIcon = (props) => <BsBarChart {...props} />;
export const GearIcon = (props) => <BsGear {...props} />;
export const FileIcon = (props) => <BsFileText {...props} />;
export const FilterIcon = (props) => <BsFilter {...props} />;
export const SaveIcon = (props) => <BsSave {...props} />;
export const TrashIcon = (props) => <BsTrash {...props} />;
